import React, { Component } from 'react'
import { func } from 'prop-types';

class Student extends Component{
    constructor(props){
        super(props)
        this.state = {
            name:'Lathesh',
            roll:this.prop
        }
    }

    show = () =>{
        console.log('Half dude');
    }
    render(){
        return (
            <div>
                <h1>Hello Lathesh</h1>
                <button onClick={show}>Click</button>
            </div>

        )
    }
}


export default Student;
